_format_version: "1.1"
_workspace: default
_info:
  select_tags:
  - dontdelete
services:
- connect_timeout: 60000
  host: httpbin.org
  name: httpbin.org
  path: /anything
  port: 80
  protocol: http
  read_timeout: 60000
  retries: 50
  write_timeout: 60000
  routes:
  - id: 5a593a70-53b4-47c0-893d-148caf4f8ac6
    paths:
    - /test
    path_handling: v0
    preserve_host: false
    protocols:
    - http
    regex_priority: 0
    strip_path: true
    https_redirect_status_code: 426
